import {useState} from 'react'
import CarData from '../data/CarData'

function CarList() {
    let [carlist, setcarlist] = useState (CarData)
    return(

        <CarListView carlist={CarListView}/>
    )
}

export default CarList


function CarListView(props) {
    return(
        <div>
            <h2>{props.carlist[0].model}</h2>
            <p>{props.carlist[0].number}</p>
            <p>{props.carlist[0].location}</p>
        </div>
    )

}
